INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (7, 61, 5.18, 3, 1020101, 133701, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 101, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", -6.0, 10201, -285.0, "ラビリスタ");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 61, 8.77, 1, 1020102, 133901, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 201, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", -2.0, 10201, -285.0, "クリスティーナ");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (1, 61, 15.5, 6, 1020103, 133801, "2030/01/01 14:59:59", "2025/01/31 12:00:00", 301, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 0.0, 10201, -285.0, "ネネカ");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (5, 61, 9.061, 2, 1020201, 134301, "2030/01/01 14:59:59", "2025/02/28 12:00:00", 101, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 0.0, 10202, -285.0, "ランファ");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 61, 7.699, 1, 1020202, 134401, "2030/01/01 14:59:59", "2025/02/28 12:00:00", 201, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 0.0, 10202, -285.0, "チカ");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 61, 8.595, 1, 1020301, 134601, "2030/01/01 14:59:59", "2025/03/31 12:00:00", 101, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 0.0, 10203, -285.0, "アオイ");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 61, 7.758, 1, 1020302, 134501, "2030/01/01 14:59:59", "2025/03/31 12:00:00", 201, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 0.0, 10203, -285.0, "クローチェ");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (6, 61, 7.0, 2, 1020401, 132302, "2030/01/01 14:59:59", "2025/04/30 12:00:00", 101, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 0.0, 10204, -285.0, "ルイズマリー");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 61, 7.904, 1, 1020402, 132402, "2030/01/01 14:59:59", "2025/04/30 12:00:00", 201, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 0.0, 10204, -285.0, "イロハ");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 61, 8.487, 4, 1020403, 132502, "2030/01/01 14:59:59", "2025/04/30 12:00:00", 301, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 0.0, 10204, -285.0, "ソノ");
